import React, {useEffect, useState } from 'react';

function Login(props){
  const [email, setEmail] = useState();
  const [password, setPassword] = useState();

  return(
    <div>
      <h1>Please log in</h1>
      <form>
        <label>
          <p>Username</p>
          <input type="text" />
        </label>
        <label>
          <p>Password</p>
          <input type="password" />
        </label>
        <div>
          <button type="submit">Submit</button>
        </div>
      </form>
    </div>
)}

export default Login;
